  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains closed and obligated
  projects funded under the following Hazard Mitigation Assistance (HMA) grant programs:
  Repetitive Flood Claims (RFC). The RFC grant program was authorized by the Bunning-Bereuter-Blumenauer
  Flood Insurance Reform Act of 2004, which amended the National Flood Insurance Act
  of 1968. The RFC provides funding to reduce or eliminate the long-term risk of flood
  damage to structures insured under the National Flood Insurance Program (NFIP) that
  have had one or more claim payments for flood damages.\",\n\t\"license_title\":
